id: If_Match_header_CPDoS
info:
  name: Compare Response Codes
  author: raff
  severity: high
  description: Fuzzing 

http:
  - raw:
      - |
        GET {{BaseURL}}?cachetest1=H1raff1 HTTP/1.1
        Host: {{Hostname}}
      - |
        GET {{BaseURL}}?cachetest2=H1raff2 HTTP/1.1
        Host: {{Hostname}}

        
    
    
      - |
        GET {{BaseURL}}?cachetest2=H1raff2 HTTP/1.1
        Host: {{Hostname}}

        
      
      - |
        GET {{BaseURL}}?cachetest2=H1raff2 HTTP/1.1
        Host: {{Hostname}}
    req-condition: true

    matchers-condition: and
    matchers:
      - type: dsl
        dsl:
          - 'status_code_4 == 413 && status_code_1 != 413'